// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './layout/Navbar';
import Bubblesort from './layout/Bubblesort';

export default function App() {
  return (

    <Router>
      <Navbar />
      <Routes>
        <Route path="/bubble-sort" element={<div>Bubble Sort Visualization</div>} />
        <Route path="/merge-sort" element={<div>Merge Sort Visualization</div>} />
        <Route path="/quick-sort" element={<div>Quick Sort Visualization</div>} />
      </Routes>
    </Router>
  );
}
